# Delivering of the project specific activities as defined in the contract;
# Coordinating and planning: preparing Oxfam Partner Agreement with Oxfam Country Offices and other
agreements with partner organisations, (annual) plans and budgets, progress reports (narrative and finance), audits, MEAL, reviews and evaluation;
# Matrix management of Project Leads at country and global level;
# Supporting and strengthening the implementing partners at country and global level;
# Ensuring quality and consistency by setting standards for project implementation;
# Providing processes and systems for project management;
# Ensuring information flows across the Steering Committee, PMU, implementing partners and allies;
# Monitoring project risks and establishing mitigation measures.
